import React from 'react';
import ReactDOM from 'react-dom';
import {createStore} from 'redux';
import appRedux from './redux';
import './index.css';
import App from './App';

let store = createStore(appRedux);


  ReactDOM.render(
    <React.StrictMode>
      <App store={store} />
    </React.StrictMode>,
    document.getElementById('root')
  );



